import React from 'react';
import AnotherFile from './testItem/anotherFile'; 
import Items from './testItem/testItem.component';
import '../test/testItem/testItem.styles.scss'

class Test extends React.Component{
    constructor(){
        super(); 
        this.state = {
            name: 'Jampa',
            location:'Oakland',
            age: 49
         }
    }
    render(){
        return (
        <div className="item">
                <p>Hi, my name {this.state.name} </p>
                  {name, location, age} = this.state
                 <Items 
                    name={name} 
                    location={location} 
                    age= {age} 
                    />
                 <AnotherFile  name={this.state.name} location={this.state.location}/>
         </div>
        )
    }
}
export default Test
